import "./Layout.css";
import { Link } from "react-router-dom";

export default function Layout(props) {
  return (
    <div>
      <header>
        <Link to="/">
          <h1>The Collective</h1>
        </Link>
        <Link to="/login">Login/Register</Link>

      </header>
      {props.children}
      <h1>probably landing page</h1>
    </div>
  );
}
